import Header from './components/Header';
import Authors from './components/Authors';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      data: []
    }
  }

    render() {
      return (
        <div className="App">
        <Header />
        <Authors data={this.state.data}/>
      </div>
      )
    }
}

export default App;
